import React, {Component} from "react";

class Social extends Component {
    render() {
        return(
            <>
                <div className="w3-display-bottomleft w3-text-grey w3-large" style={{padding: "24px 48px"}}>
                    <i className="fa fa-facebook-official mr-5 w3-text-black w3-hover-text-teal"></i>
                    <i className="fa fa-instagram mr-5 w3-text-black w3-hover-text-teal"></i>
                    <i className="fa fa-snapchat mr-5 w3-text-black w3-hover-text-teal"></i>
                    <i className="fa fa-pinterest-p mr-5 w3-text-black w3-hover-text-teal"></i>
                    <i className="fa fa-twitter mr-5 w3-text-black w3-hover-text-teal"></i>
                    <i className="fa fa-linkedin mr-5 w3-text-black w3-hover-text-teal"></i>
                </div>
            </>
        );
    }
}

export default Social
